INSERT INTO `combo` (`idcombo`, `combo`, `comments`, `video`, `user_iduser`, `character_idcharacter`, `submited`, `damage`, `type`, `verified`, `patch`, `author`, `password`) VALUES
(6, '2 M > 236 S > 236 L M > 6 6 > 2 M > 5 M > H > 214 M > M H > 4 4 > M > H > S > 2 S > H S > L > M > 8 > L > L > 236 L > L > L > 214 L M ', '-Near Corner\r\n-Universal (with adjustments)\r\n-7 bars, Lv. 2+ sparking\r\n\r\n(As of v1.14) Niagara Pummel (with smash) does not trigger damage penalty for later supers without Ultimate Z Change.\r\nVegetaBlue can cross-under and hook the opponent backward with his 5H. Slightly delay 5S afterward in case 5H hit a bit too hight.\r\nThanks to the damage buff to Lv. 3 supers in v1.14. Final Flash Attack (Lv.5) now deals about 2500 when fully scaled.\r\n\r\nCredit: Muto6', 'https://youtu.be/I2ZFXeefPDc?t=108', NULL, 5, '2019-03-17 02:18:46', 10000, 0, NULL, NULL, NULL, NULL),
(7, '214 H > 236 9 S > 2 M > H > 236 9 S > H > 236 S > M H > 6 6 > M > S > M > 9 > L > L > 2 H > 9 > M > H > M H > 6 6 > L M > 214 L M ', '-Corner\r\n-Universal\r\nTo perform a tigerknee off a jump-cancellable move like 5H (in sparking), slightly delay the input of 2369 after 5h connects, because 5H has long active frames. Doing \'2369\' early could either result in not getting \'9\' registered or missing the buffer window of \'236\'.\r\n', 'https://youtu.be/I2ZFXeefPDc?t=82', NULL, 1, '2019-03-17 02:19:49', 10000, 0, NULL, NULL, NULL, NULL),
(8, '5 M > 2 M > 236 M > 2 M > 5 M > 9 > L > L > S > 6 6 > L > S > L > L > 9 > L > L > S > 6 6 > L > S > L > L > L > S H > L > L > 2 H > 8 > L > L > S > 236 L > M H > S > 214 H > 214 L M ', 'Corner\r\n\r\nAfter 236M, ensure 2M connects low (or delay 5M). Otherwise the opponent would be a bit too high and j.LL would gain unwanted height.\r\nDon\'t rush for j.S after air-dash j.L, as j.L would push the dummy upward very slightly. Delaying j.S by a frame or two would make Goku relatively lower and create a longer window to link 5L.', 'https://youtu.be/I2ZFXeefPDc?t=50', NULL, 2, '2019-03-17 02:20:38', 10000, 0, NULL, NULL, NULL, NULL),
(9, '2 M > 5 M > 9 > M > H > 2 H > S H > M > H > 2 H > 9 > L > L > L > S > 214 M > A2 > 9 > L > L > L > 2 H > 9 > L > L > L > A1 > 214 L > 214 S > H M > L M > 236 H > 236 L M > A2 > 4 A1 ', '', 'https://twitter.com/Ikkisoad/status/1034131516132077570', NULL, 20, '2019-03-17 02:21:59', 9792, 3, NULL, '1.14', NULL, NULL),
(12, '1 M > 5 M > 9 > j. M > j. L > j. L > 9 > j. L > j. L > A1 > j. L > L > L > 9 > j. L > j. M > j. L > j. 2 H > H S > j. L > j. M > j. L > j. 2 H > 9 > j. L > j. L > j. L ', '', 'https://twitter.com/Ikkisoad/status/1028480317236158465', NULL, 21, '2019-03-17 02:45:28', 4697, 0, NULL, '1.15', NULL, NULL),
(13, '2 H > H S > j. M > j. S > 236 M > A1 > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. L ', '', 'https://twitter.com/oPrieZT/status/1106796309116276736', NULL, 21, '2019-03-17 19:13:29', 4365, 0, NULL, '1.14', NULL, NULL),
(19, '2 M > 214 M > L M H S > L > L > L > S H > j. M > j. 2 H > 9 > j. L > j. L > j. L > j. S > j. 214 M > A2 > 9 > j. L > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. L > A1 > j. 214 L > 214 S > dl. > M H > [ L M ] > A2 > 236 L M > A1 > 4 A2 ', '', 'https://twitter.com/Ikkisoad/status/1016896659610062853', NULL, 20, '2019-03-18 16:13:35', 10113, 3, NULL, '1.14', NULL, NULL),
(21, 'dp LP > qcf qcf P > df > dp P > HP HK > j. HP > HP > qcf HP ', '', 'https://www.youtube.com/watch?v=iGnJ4iHcaQg', NULL, 172, '2019-03-19 20:38:07', 0, 0, NULL, '', '', NULL),
(26, '236 H > j. 2 H > 9 > j. H > j. 236 H > [ H M ] > 4 4 > H > 9 > j. S > 6 6 > j. L > j. S > M > H > S > S > j. 236 L > j. L > j. L > 2 H > 9 > j. L > j. L > j. S > j. 236 L > M H > 236 S > 214 L M ', 'It\'s still a TOD without the last ki blast', 'https://youtu.be/qlV7nP25nRg?t=293', NULL, 21, '2019-03-20 01:28:01', 10182, 3, NULL, '1.14', NULL, NULL),
(27, 'H > 9 6 > j. H > j. 236 S > j. S > L > H > 9 > j. M > j. H > j. 236 S ~ S > j. L > j. L > j. L > j. 236 S ~ S  > j. L > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. L > j. 214 H > H M > 236 H > [ M H ] > [ L M ] > 214 S > j. 214 L M ', 'Last character only to TOD', 'https://twitter.com/KyePerson/status/1105848060981047302', NULL, 20, '2019-03-20 02:10:46', 10000, 3, NULL, '1.14', NULL, NULL),
(28, '2 M > 5 M > 9 > j. M > j. 2 H > H S > j. M > j. 2 H > j. L > j. L > j. S > j. 214 M > A1 > 9 > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. 236 S > H M > [ L M ] ', '', '', NULL, 20, '2019-03-20 05:12:13', 5331, 0, NULL, '1.15', NULL, NULL),
(29, '2 M > 5 M > 9 > j. M > j. 2 H > S H > j. M > j. 2 H > 9 > j. L > j. L > j. S > j. 214 M > A1 > 9 > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. 214 M > 236 L M ', '', '', NULL, 20, '2019-03-20 05:24:11', 5449, 0, NULL, '1.15', NULL, NULL),
(30, '2 M > M > j. M > H > 236 M > 2 H > j. M > H > S > [ H S ] > M > H > S > 236 M > 236 L M ', 'Corner/ close to corner combo', '', NULL, 28, '2019-03-20 09:52:59', 6032, 0, NULL, NULL, NULL, NULL),
(31, '5 B > 6 B >  6 C > 2 C > 5 C > 3 C > j. C > j. 2 C > 6 6 C > 2 2 C', 'Basic bnb that ends with double buffs.', '', NULL, 203, '2019-03-20 12:38:27', 3075, 0, NULL, '', '', NULL),
(32, '2 A A > C > 214 A > 6 B > j. [ C ] > 236 [ B ] > 6 6 C > 2 2 A', 'Bnb off a bad starter (2AA, 5A > 2A etc.) without the use of a grd bar for FF. Can end in either 236AA or 214A for more meterless damage.', '', NULL, 203, '2019-03-20 13:51:09', 2427, 0, NULL, '', '', NULL),
(33, 'B > C > 3 C > j. A B C > 6 6 B > j. 236 A > 2 B > 2 C > 236 A > 6 A > 6 A ', 'Damage is without vorpal. Pretty simple Enkidu bnb. You can do the same combo if you hit with 5C instead of 5B, just remember to reverse the start (I.e 5C > 5B > 3C).', '', NULL, 202, '2019-03-20 14:11:13', 2883, 0, NULL, '', '', NULL),
(34, '2 A > B > C > 2 C > 3 C > j. A B B > 6 6 C > 236 [ B ] ', 'Bnb off a bad starter like 2A, 2AA, 5A etc. Damage is without vorpal and different depending on starter. If you hit the 214 [B] near corner you can extend the combo using 5B.', '', NULL, 202, '2019-03-20 14:18:04', 2600, 0, NULL, '', '', NULL),
(35, '2 A A A > 2 B > 5 B B > 4 B > j. [ C ] > j. 2 [ B ] > 6 6 C > 236 [ B ] > 2 C > 3 C > 214 A A', '2821 damage with Vorpal.', 'https://youtu.be/9rL0zzFbljw', NULL, 200, '2019-03-20 15:11:12', 2571, 0, NULL, '', '', NULL),
(39, '2 M > M > 4 M > 2 j. M > L > L > 2 H > [ H S ] > M > L > 2 H > M > L > 2 S > 214 L', 'Corner BnB. Not 100% sure it\'s optimal', '', NULL, 33, '2019-03-20 16:58:59', 3894, 0, NULL, NULL, NULL, NULL),
(40, '2 M > 6 H > 236 M [ L A1 ] L > 6 H > 236 M L [ L A1 ] > j. M > L > L > 2 H > [ H S ] > M > L > L > j. L L L ', 'Corner Combo for the team I use. Timing the assists can be a little difficult but a little practice will help. You can add super\'s onto the end for more damage.', '', NULL, 33, '2019-03-20 17:18:40', 5235, 0, NULL, NULL, NULL, NULL),
(43, 'M > 2 M > H > S > 2 S > L > L > 2 S > [ H S ] > L > L > 2 H > L > L > [ H A1 ] > [ L M ] > 236 S > 236 [ L M ] [ L M ] [ L M ] > 236 A2 > 214 A1 ', 'Variant of Krillin corner combo that causes TOD on any non-sparking character.', 'https://www.youtube.com/watch?v=1Y5903sGd8k', NULL, 8, '2019-03-20 20:40:08', 10163, 0, NULL, NULL, NULL, NULL),
(44, 'M > 2 M > H > S > 2 S > L > L > 2 S > [ H S ] > L L > 2 H > L > L > [ H A1 ] > [ L M ] > 236 S > 214 [ L M ]', 'Leads to hard knockdown. Optimal Krillin corner route. Can substitute j. S > 236 H over H [Goku Assist] for similar effect and one more bar.', '', NULL, 8, '2019-03-20 20:46:04', 6777, 0, NULL, NULL, NULL, NULL),
(45, 'B > 6 B > 6 C > [ B C ] > 2 2 A > 6 6 B > 214 [ A ] > 6 6 C > 236 A dl. A > 2 C > C > 2 2 C ', 'Standard bnb that ends with double buffs. Works with 5C / 6B / 214 start as well.', '', NULL, 203, '2019-03-20 23:48:15', 3619, 0, NULL, '', '', NULL),
(46, '2 M > 5 M > 9 > j. M > j. H > j. L > 9 > j. M > j. H > j. L > S > 2 M > 5 M > 2 H > H S > j. M > j. L > 9 > j. L > j. L > j. 236 S > 236 L M ', '', '', NULL, 16, '2019-03-21 00:41:07', 7075, 3, NULL, '1.14', '', NULL),
(47, '2 M > 5 M > 2 H > H S > j. M > j. L > 9 > j. L > j. M > j. [ S ] > j. 236 S > 236 L M ', '-Corner\r\n-j. [ S ] must be in the corner', '', NULL, 16, '2019-03-21 00:45:24', 5050, 0, NULL, '1.15', NULL, NULL),
(48, '2 M > 5 M > 2 H > H S > j. M > j. L > 9 > j. L > j. L > j. 2 S > j. 2 H ', 'Mid screen bnb', '', NULL, 16, '2019-03-21 00:47:00', 4015, 0, NULL, '1.15', NULL, NULL),
(49, '2 M > 5 M > 1 S > H S > j. M > j. L > 9 > j. L > j. M > A1 > j. 2 H > 2 H > S H > j. M > j. L > 9 > j. L > j. L > j. L ', 'Delay the last auto combo or else Frieza will be too low to hit the H.\r\nDoes 4722 damage if you use only one hit of the M in the last auto combo.', '', NULL, 16, '2019-03-21 00:50:38', 4827, 0, NULL, '1.15', NULL, NULL),
(50, '1 M > 5 M > 9 > j. M > j. L > j. L > 9 > j. L > j. L > A1 > j. L > 9 > j. M > j. L > j. L > 9 > j. L > L > dl. j. S > A2 > 2 9 > j. L > j. L > j. 2 H > S H > j. M > j. L > j. L > 9 > j. L > j. L > j. L ', 'Should use only 1 hit of the last M, else the H will whiff', '', NULL, 21, '2019-03-21 01:00:53', 4902, 0, NULL, '1.14', NULL, NULL),
(51, '5 M > 9 > j. M > H > 2 L > L > L > 2 M > 5 M > 9 > j. L > j. M > j. L > j. 2 H > S H > j. L > j. M > j. L > j. 2 H > 9 > j. L > j. L > j. L ', '-Big bodies only, corner only\r\n-Works on 16, Cooler and Broly\r\n', 'https://twitter.com/Ikkisoad/status/1112008199719264262', NULL, 21, '2019-03-21 01:04:12', 4897, 0, NULL, '1.15', NULL, NULL),
(52, '5 M > 9 > j. M > j. H > A1 > 6 6 > 214 M > 2 M > 5 M > 9 > j. L > j. M > j. L > j. 2 H > j. L > j. L > j. S > j. 236 L M ', '-Big bodies only, mid screen. Probably only works with Cooler, Broly and 16.\r\n-If 21 spawns on their left side you don\'t need to dash to grab', 'https://twitter.com/Ikkisoad/status/1108536635359150086', NULL, 21, '2019-03-21 01:12:05', 5612, 0, NULL, '1.15', NULL, NULL),
(53, '2 M > 5 M > 9 > j. M > j. H > S H > j. M > j. 2 H > j. L > j. L > j. S > j. 236 S > H M > [ L M ] ', '', '', NULL, 20, '2019-03-21 01:36:32', 4571, 0, NULL, '1.15', NULL, NULL),
(54, '2 M > 5 M > j. M > j. L L > j. 2 H > S H > j. M > j. L L > j. 2 H > 9 > j. L > j. L > j. S > j. 236 S > H M > [ L M ] ', '', '', NULL, 20, '2019-03-21 01:38:10', 4684, 0, NULL, '1.15', NULL, NULL),
(55, '2 M > 5 M > 9 > j. M > j. 2 H > H S > j. M > j. 2 H > 9 > j. L > j. L > j. S > j. 214 S ~ M > 236 L M ', '', '', NULL, 20, '2019-03-21 01:40:50', 5042, 0, NULL, '1.15', NULL, NULL),
(56, '2 M > 5 M > 9 > j. M > j. L > j. L > j. 2 H > S H > j. M > j. L > j. L > j. 2 H > 9 > j. L > j. L > j. S > j. 214 M > 236 L M ', '', '', NULL, 20, '2019-03-21 01:41:53', 4992, 0, NULL, '1.15', NULL, NULL),
(57, '2 M > 5 M > 9 > j. M > j. 2 H > S H > j. M > j. 2 H > 9 > j. L > j. L > j. S > j. 214 M > M H > 6 6 > L > L > L > S H > j. M > j. 2 H > 9 > j. L > j. L > j. L ', '', '', NULL, 20, '2019-03-21 01:44:02', 5195, 3, NULL, '1.14', NULL, NULL),
(58, '2 M > 5 M > j. M [2hit] >  214 M >  empty vanish > j. M [1hit] > 6 6 j. L > j. M [land] > j. L L [2hit] > j. 2 H > j. L > j. M [2hit] > j. 2 H > j. L L [2hit] > 214 M ', 'bardock rejump in spark for big damage. Note: can\'t do 5LL in the combo, has to be 2L>2M or 5L>2M in confirms.', 'https://streamable.com/s/gn1lu/hzvhuk', NULL, 26, '2019-03-21 06:18:33', 5853, 0, NULL, NULL, NULL, NULL),
(61, '2 LK > 2 MK > HP > MP HK > HP ~ 236 MK -> HK ~ j. LK > j. MK > j. HK > 2 LK > 2 MK > HK ~ j. LP > j. MK > j. HK > LP > LP > MP > 2 HP ~ 236 HP ', 'Works on all characters and probably works with a lot of other assists too. You can spend 1 bar after 236MK for more damage by using daisy pusher, and you can add battle opera at the end and do a spaced 2HP for a burst bait.', 'https://youtu.be/zMijEjxyca8', NULL, 149, '2019-03-21 14:11:43', 7403, 0, NULL, NULL, NULL, NULL),
(62, 'j. MK > d MP > MP > qcf K > P > qcf K > d P', 'Standard combo from cross-up j.mk.', '', NULL, 46, '2019-03-21 14:32:20', 0, 0, NULL, '', '', NULL),
(63, 'B > C > 3 C > 623 A > 623 B > 2 B > 236 [ B ] > B > 6 C > 236 A > 6 A > 6 A ', 'Corner combo. Works off 5C > 5C > 3C as well.', '', NULL, 202, '2019-03-21 16:56:35', 3405, 0, NULL, '', '', NULL),
(64, '2 A > B > C > 3 C > 623 B > 2 B > 236 [ B ] > B > 6 C > 236 A > 6 A > 6 A ', 'Corner combo of a bad starter (2A, 5A, 2AA etc).', '', NULL, 202, '2019-03-21 17:01:35', 2985, 0, NULL, '', '', NULL),
(65, '2 M > 5 M > 2 9 > j. M H > 236 M > j. 2 H > 9 > j. L L L S > [ H S ] > j. L L L S > 236 M > [ M H ] > 214 M > A1 > [ L M ] > 236 [ L M ] ', 'Works from round start to corner', '', NULL, 28, '2019-03-21 18:37:46', 6916, 0, NULL, NULL, NULL, NULL),
(66, '2 M > 5 M > 9 > j. M > j. H > j. 2 H > S H > j. M > j. H > j. 2 H > 9 > j. L > j. L > j. L > j. S > j. 214 S > dl. M H > [ L M ] ', 'Corner', '', NULL, 20, '2019-03-21 21:04:21', 5111, 0, NULL, '1.15', NULL, NULL),
(67, '2 M > 5 M > 9 > j. M > j. H > j. 2 H > S H > j. M > j. H > j. 2 H > 9 > j. L > j. L > j. L > j. S > j. 214 M > 236 L M ', 'Corner', '', NULL, 20, '2019-03-21 22:05:59', 5419, 0, NULL, '1.15', NULL, NULL),
(68, '2 M > dl. 5 M > 5 H > S H > j. M > j. 2 H > 9 > j. L > j. L > j. S > j. 214 M ', '', '', NULL, 20, '2019-03-21 22:10:20', 3870, 0, NULL, '1.15', NULL, NULL),
(69, '2 M > 5 H > 5 S > 236 S > [ L M H S ] > dl. 6 6 > j. [ H A2 ] > Land > 5 H > 5 S > 2 S > 2 9 > j. L L L S > [ H S ] > j. L L L > j. 2 H > 9 > j. L L L S > 236 L > 236 [ L M ] > dl. A2 > A1 > [ H S ] (Hold)', 'Mid is Tohan for this combo, but honestly anyone will work, some members of the cast can kill without the last 2 bars. Needs corner.\r\nGoku assist is optional but makes timing the j.H into 5H much easier. Basically, this is a universal corner ToD route for Vegito, any assist will work here.', '', NULL, 28, '2019-03-22 06:15:23', 11082, 0, NULL, NULL, NULL, NULL),
(70, '2 M > 5 S > 2 S > 7 (Hold) > j. L L L > j. 2 H > j. L L L S > [ H S ] > j. L L L S > 236 M > [ M H ] > 214 M > 236 [ L M ] ', 'Solo, works only when you are the one in the corner', '', NULL, 28, '2019-03-22 06:20:10', 6425, 0, NULL, NULL, NULL, NULL),
