(889, '5 M > 2 M ~ 1 S > 5 M > 9 > j. M > j. 2 S > j. H > j. L > j. 9 > j. L > j. 2 S > j. H > j. M > (land) 2 M ~ 5 M > 9 > j. L > j. 2 S > j. H > j. M > (land) 2 M > 5 [ S ] > 5 M > 5 H > 214 S > 5 [ S ] > 2 2 S > M H > [ L M ] > 236 L > 214 L M ', 'Corner big body', 'https://twitter.com/yxiao1988/status/1221260197936562176?s=19', NULL, 16, '2020-01-27 01:19:54', 10001, 0, NULL, '', 'yxiao1988', 'pass'),
(892, '2 H > H S > j. L L 2 H > 9 j. L L H ', '', 'https://twitter.com/inigmatestacc/status/1228057994757320705?s=20', NULL, 21, '2020-02-13 20:49:18', 3210, 0, NULL, '1.20', '', 'kidbuu2h'),
(893, '2 M ~ 5 H ~ 2 H ~ H S >  j. L L ~ 9 ~ j. L L ~ j. 2 H > dl. 214 L ~ M H > 214 L > L > 236 M ', 'Metered Midscreen BNB. Switches sides. \r\nCan be started with j.H, 5L, 2L, 5M, and 2H for less damage, or 5LL for more damage. \r\nFor extra damage, replace j.LL ~ j.LL with j.MLL ~ 9 > dl. j.LL. \r\nFor super, replace the final Medium Gale Claw with L and a super of your choice.\r\nThe more hits the combo has before 2H, the tighter the timing is on the delayed Light Gale Claw.', 'https://youtu.be/-PCP4dzJ8ck', NULL, 9, '2020-02-13 21:01:29', 4564, 0, NULL, '1.16', '', 'e2rteth24rrt');
